import '@ui5/webcomponents-fiori/dist/UploadCollectionItem.js';
import { UploadState, ListItemType } from '../../enums';
import { withWebComponent } from '../../internal/withWebComponent';
/**
 * A component to be used within the `UploadCollection`.
 *
 * <ui5-link href="https://sap.github.io/ui5-webcomponents/playground/components/UploadCollection" target="_blank">UI5 Web Components Playground</ui5-link>
 */
const UploadCollectionItem = withWebComponent('ui5-upload-collection-item', ['file', 'fileName', 'progress', 'uploadState', 'type'], ['disableDeleteButton', 'fileNameClickable', 'hideRetryButton', 'hideTerminateButton', 'selected'], ['thumbnail', 'deleteButton'], ['file-name-click', 'rename', 'retry', 'terminate', 'detail-click']);
